import React, { useEffect } from 'react';
import auth from './service/authService';
import Channel from './components/Channel/Channel';

let socket;

const App = () => {

  useEffect(() => {
    auth.login({
      email: 'email@gmail.com',
      password: 'password',
    });
    socket = io('http://localhost:8001/channel');
  });

  return (
    <div>
      <Channel />
    </div>
  );
};

export default App;
